export const goToHomePage = (history)=>{ 
    history.push('/')}

    
export const goToDetailsPage = (history, name)=>{ 
    history.push(`/detail/${name}`)}

    
export const goToPokedexPage = (history)=>{ 
    history.push('/pokedex')}

export const goBack = (history) => {
        history.goBack()
    }
